import React from 'react';

function ProgressComp(id) {
    return (
        <div id={id} className="progressBar">
            <div className="percent">25%</div>
        </div>
    );
}

function Main() {
    return (
        <main>
            <section id="progress">
                <ProgressComp name="first" />
                <ProgressComp name="second" />
                <ProgressComp name="third" />
            </section>
            <section id="controls"></section>
        </main>
    );
}

export default Main;
